et data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\narrays.validate_contract()\n\nwith performance_report(filename=\"dask-report.html\"):\n        t = time.perf_counter()   \n        pca=InSituIncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n        print(\"pca, \", pca, flush=True)\n        l = pca.fit(gt, [\"t\", \"X\", \"Y\"], [\"X\"], [\"Y\"]) \n        #cpt = [pca.mean_ , pca.var_ , pca.components_ , pca.explained_variance_ , pca.explained_variance_ratio_ , pca.singular_values_ ]\n        # Submit the task graph to the scheduler\n        cpt = [ pca.explained_variance_ , pca.singular_values_]\n        explained_variance ,singular_values  = client.persist(cpt)\n        explained_variance , singular_values = client.compute([explained_variance ,singular_values])    \n        print(\"explained_variance ,singular_values: \", explained_variance.result(), \" and \" , singular_values.result(), flush=True)\nprint(\"Done in :\", time.perf_counter() - t, flush=True)\n\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"coordinates":null,"group":null,"render_mode":"css","source":{"id":"1214"},"text":{"field":"cpu"},"text_font_size":{"value":"1em"},"x":{"field":"x"},"x_units":"screen","y":{"field":"y"},"y_units":"screen"},"id":"1247","type":"LabelSet"},{"attributes":{},"id":"1080","type":"LinearScale"},{"attributes":{"coordinates":null,"data_source":{"id":"1038"},"glyph":{"id":"1067"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1069"},"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1071"}},"id":"1070","type":"GlyphRenderer"},{"attributes":{"dimensions":"width"},"id":"1094","type":"WheelZoomTool"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"axis":{"id":"125
